AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAJY81WYMeiRBAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAH4JGnUuCeRAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAENraqSYD+EAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA5EO3DtwPpAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAHFT1hSSCOBAGHxf8rn810AAAAAAAAAAAAAAAAAAAAAAJsRMttcB0EAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAthSxbv0QAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA","dtype":"float64","order":"little","shape":[579]}},"selected":{"id":"1321"},"selection_policy":{"id":"1320"}},"id":"1213","type":"ColumnDataSource"},{"attributes":{"below":[{"id":"1163"}],"center":[{"id":"1165"},{"id":"1168"}],"left":[{"id":"1166"}],"name":"bandwidth_worker_heatmap","renderers":[{"id":"1174"}],"right":[{"id":"1176"}],"sizing_mode":"stretch_both","title":{"id":"1153"},"toolbar":{"id":"1169"},"toolbar_location":null,"x_range":{"id":"1155"},"x_scale":{"id":"1159"},"y_range":{"id":"1157"},"y_scale":{"id":"1161"}},"id":"bk-bandwidth-worker-plot","subtype":"Figure","type":"Plot"},{"attributes":{"base":60,"mantissas":[1,2,5,10,15,20,30],"max_interval":1800000.0,"min_interval":1000.0,"num_minor_ticks":0},"id":"1461","type":"AdaptiveTicker"},{"attributes":{},"id":"1141","type":"ResetTool"},{"attributes":{"dimensions":"width"},"id":"1142","type":"PanTool"},{"attributes":{"base":24,"mantissas":[1,2,4,6,8,12],"max_interval":43200000.0,"min_interval":3600000.0,"num_minor_ticks":0},"id":"1462","type":"AdaptiveTicker"},{"attributes":{"coordinates":null,"group":null,"text":"Bandwidth by Worker"},"id":"1153","type":"Title"},{"attributes":{"days":[1,8,15,22]},"id":"1465","type":"DaysTicker"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 289.88 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 2047 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 40751.76 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 839.71 s &lt;/li&gt;\n&lt;li&gt; transfer time: 221.23 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://188.185.68.194:46102 &lt;/li&gt;\n          &lt;li&gt; Workers: 160 &lt;/li&gt;\n          &lt;li&gt; Threads: 160 &lt;/li&gt;\n          &lt;li&gt; Memory: 2.33 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.09.1 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.09.1 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_jobqueue import SLURMCluster\nfrom distributed import Client\nfrom dask import delayed\n\nfrom dask.distributed import performance_report, get_task_stream\n\nimport logging\nlogging.basicConfig(format='%(levelname)s:%(message)s', level=logging.DEBUG)\n\nimport argparse\nparser = argparse.ArgumentParser()\nparser.add_argument(\"-c\", \"--cores\", type=int, default=4)\nparser.add_argument(\"-N\", \"--Nodes\", type=int, default=1)\nparser.add_argument(\"-f\", \"--files\", type=int, default=100)\nparser.add_argument(\"-p\", \"--pts\", type=int, default=400)\nparser.add_argument(\"-r\", \"--runs\", type=int, default=3)\nargs = parser.parse_args()\n\n#import pdb; pdb.set_trace()\n\ncluster = SLURMCluster(memory='{}g'.format(16*args.cores),\n                       processes=args.cores,\n                       cores=args.cores,\n                       queue='photon',\n                       #python='python',\n                       local_directory='/tmp/ikabadzh',\n                       header_skip=['-n 1', '-t 00:30:00'],\n                       job_extra=['--ntasks-per-node=1', '-t 8:00:00'])\n\n#import pdb; pdb.set_trace()\ncluster.scale(jobs=args.Nodes)\n#print(cluster.get_logs())\nclient = Client(cluster)\n\n\nimport ROOT\nROOT.gROOT.SetBatch(True)\n\nRDataFrame = ROOT.RDF.Experimental.Distributed.Dask.RDataFrame\n\n\n\ndef dimuonSpectrum(df):\n    # Select events with exactly two muons\n    df_2mu = df.Filter(\"nMuon == 2\", \"Events with exactly two muons\")\n\n    # Select events with two muons of opposite charge\n    df_os = df_2mu.Filter(\n        \"Muon_charge[0] != Muon_charge[1]\", \"Muons with opposite charge\")\n\n    # Compute invariant mass of the dimuon system\n    df_mass = df_os.Define(\n        \"Dimuon_mass\",\n        \"ROOT::VecOps::InvariantMass(Muon_pt, Muon_eta, Muon_phi, Muon_mass)\")\n\n    # Book histogram of dimuon mass spectrum\n    bins = 30000  # Number of bins in the histogram\n    low = 0.25  # Lower edge of the histogram\n    up = 300.0  # Upper edge of the histogram\n\n    hist = df_mass.Histo1D(ROOT.RDF.TH1DModel(\n        \"\", \"\", bins, low, up), \"Dimuon_mass\")\n\n    # Create canvas for plotting\n    ROOT.gStyle.SetOptStat(0)\n    ROOT.gStyle.SetTextFont(42)\n    c = ROOT.TCanvas(\"c\", \"\", 800, 700)\n    c.SetLogx()\n    c.SetLogy()\n\n    client.wait_for_workers(args.Nodes)\n    watch = ROOT.TStopwatch()\n    hist.GetValue() # triggers the event loop\n    elapsed = watch.RealTime()\n    file_out = open('../../distrdf_timestamps.out', 'a')\n    file_out.write(\"\\ncores={} Nodes={}: Event Loop={}s\\n\".format(args.cores, args.Nodes, elapsed))\n    file_out.close()\n\n    # Draw histogram\n    hist.GetXaxis().SetTitle(\"m_{#mu#mu} (GeV)\")\n    hist.GetXaxis().SetTitleSize(0.04)\n    hist.GetYaxis().SetTitle(\"N_{Events}\")\n    hist.GetYaxis().SetTitleSize(0.04)\n    hist.SetStats(False)\n    hist.Draw()\n\n    # Draw labels\n    label = ROOT.TLatex()\n    label.SetTextAlign(22)\n    label.DrawLatex(0.55, 3.0e4, \"#eta\")\n    label.DrawLatex(0.77, 7.0e4, \"#rho,#omega\")\n    label.DrawLatex(1.20, 4.0e4, \"#phi\")\n    label.DrawLatex(4.40, 1.0e5, \"J/#psi\")\n    label.DrawLatex(4.60, 1.0e4, \"#psi'\")\n    label.DrawLatex(12.0, 2.0e4, \"Y(1,2,3S)\")\n    label.DrawLatex(91.0, 1.5e4, \"Z\")\n    label.SetNDC(True)\n    label.SetTextAlign(11)\n    label.SetTextSize(0.04)\n    label.DrawLatex(0.10, 0.92, \"#bf{CMS Open Data}\")\n    label.SetTextAlign(31)\n    label.DrawLatex(0.90, 0.92, \"#sqrt{s} = 8 TeV, L_{int} = 11.6 fb^{-1}\")\n\n    # Save Canvas to image\n    c.SaveAs(\"dimuonSpectrum.png\")\n\nif __name__ == '__main__':\n    #filelist = [\"/hpcscratch/user/ikabadzh/works/BENCH2/input_files/dimuon/f{}.root\".format(i) for i in range(1,1001)]\n    filelist = [\"input_files/dimuon/f{}.root\".format(i) for i in range(1, args.files+1)]\n    df = RDataFrame(\"Events\", filelist, npartitions=(args.pts), daskclient=client)\n    \n   \n    for r in range(args.runs): \n      with performance_report(filename=\"dask-report_{}.html\".format(r)) as ts:\n        #with get_task_stream(plot='save', filename='task-stream.html') as ts:  \n        dimuonSpectrum(df)\n      ts.figure\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"factors":["a","b"]},"id":"1157","type":"FactorRange"},{"attributes":{},"id":"1449","type":"NoOverlap"},{"attributes":{"source":{"id":"1213"}},"id":"1398","type":"CDSView"},{"attributes":{"url":"./profile?key=@name"},"id":"1138","type":"OpenURL"},{"attributes":{},"id":"1222","type":"LinearScale"},{"attributes":{"base":60,"mantissas":[1,2,5,10,15,20,30],"max_int
